import React from 'react';
import {PlayersInfo} from './PlayersInfo';

const Players = () => {
		return(
		<div>
			{
				PlayersInfo.map(((player, i) => {
					<div>
						<h1>Name: {PlayersInfo[i].name}</h1>
						<h2>Age: {PlayersInfo[i].age}</h2>
						<h2>Grand Slams: {PlayersInfo[i].grandSlams}</h2>						
					</div>
				}))
			}
		</div>
	)
}

export default Players;
